$(document).ready(function(){search_job_seeker_result()});function search_job_seeker_result(){$(".search").click(function(){var a=$('[name="major"]').val();var b=$('[name="school"]').val();var d=$('[name="current_place"]').val();var c=$('input[name="csrfmiddlewaretoken"]').prop("value");$.ajax({url:"/ucjobs/search_job_seeker_result",type:"POST",data:{csrfmiddlewaretoken:c,major:a,school:b,current_place:d},dataType:"html",success:function(f){$(".result").empty();$(".result").first().prepend(f)}});return false})};